    <style>
    html, body, table {

    h1, h2 , h3, h4, h5 {

        font-weight: bold;

        td, th {
            white-space: nowrap;
        }

    .caption {
        text-align: center;
        font-size: 90%;

    img {
        display: block;
        margin: auto;

        width: 1em;

        padding: 15px;

    div.normal textarea:invalid {

    div.selected textarea {
        display: block;
    }

        section.section, img {
            page-break-inside: avoid;
        }
    }
